import "./App.css";
import { Header } from "./components/Header";
import Home from "./components/Home";
function App() {
  return (
    <div className="bg-customColor relative w-screen">
      <Header />
      <Home />
      <div className=" fixed bottom-2 right-5">
        <button>Hello</button>
      </div>
    </div>
  );
}

export default App;
